import React from "react";
import Accordion from "react-bootstrap/Accordion";
import { Link } from "react-router-dom";

function ListWithAccordion() {
  const listOfWords = [
    {
      id: "1",
      text: "Primary Accordion Comming from Component",
      variant: "primary",
      img: "https://media.tenor.com/WU0vkiK5dNAAAAAi/memes-cat.gif",
    },
    {
      id: "2",
      text: "Secondary Accordion Comming from Component",
      variant: "secondary",
      img: "data:image/jpeg;base64,",
    },
    {
      id: "3",
      text: "Success Accordion Comming from Component",
      variant: "success",
      img: "data:image/jpeg;base64,",
    },
    {
      id: "4",
      text: "Danger Accordion Comming from Component",
      variant: "danger",
      img: "data:image/jpeg;base64,",
    },
    {
      id: "5",
      text: "Warning Accordion Comming from Component",
      variant: "warning",
      img: "data:image/jpeg;base64,",
    },
    {
      id: "6",
      text: "Info Accordion Comming from Component",
      variant: "info",
      img: "data:image/jpeg;base64,",
    },
    {
      id: "7",
      text: "Light Accordion Comming from Component",
      variant: "light",
      img: "data:image/jpeg;base64,",
    },
    {
      id: "8",
      text: "Dark Accordion Comming from Component",
      variant: "dark",
      img: "data:image/jpeg;base64,",
    },
  ];

  const Items = ({ item }) => (
    <Accordion.Item eventKey={item.id - 1}>
      <Accordion.Header>{item.text}</Accordion.Header>
      <Accordion.Body>
        <img className="img-fluid" src={item.img} placeholder="cat img" />
        <br />
        <Link to={`/listwithaccordion/${item.id}`}>Click Here to see Larger image</Link>
      </Accordion.Body>
    </Accordion.Item>
  );

  return (
    <div className="container mt-4">
      {" "}
      <h3>List With Accordion</h3>
      <Accordion defaultActiveKey={["0"]} alwaysOpen>
        {listOfWords.map((item) => (
          <Items key={item.id} item={item} /> //we have to use id other wise data printed unordered and some data reapeat also
        ))}
      </Accordion>
    </div>
  );
}

export default ListWithAccordion;
